import Link from 'next/link'

const NavBar = () => (
	<ul>
		<li><Link href="/"><a>Home</a></Link></li>
		<li><Link href="/about"><a>About</a></Link></li>

		<style jsx>{`
			ul {
				background: #333;
				color: #fff;
				list-style: none;
				display: flex;
			}

			ul li {
				font-size: 18px;
				margin-right: 20px;
			}

			ul li a {
				color: #fff;
				text-decoration: none;

			}
		`}</style>
	</ul>
)

export default NavBar
